import { IArrEl } from "../../utils/utils";

interface IList<IArrEl> {
  list: IArrEl[];
  push: (item: IArrEl) => void;
  pop: () => void;
  shift: () => void;
  unshift: () => void;
  splice: () => void;
  getSize: () => number;
}

class List<IArrEl> implements IList<IArrEl> {
  list = [];
  head = -1;
  tail = -1;
  currentIndex = 0;
  private maxSize = 6;

  push = (item: IArrEl): void => {
    if (this.getSize() < this.maxSize) {
      this.list.push(item);
    }
  };

  pop = (): void => {
    if (this.getSize()) {
      this.list.pop();
    }
  };

  shift = (item: IArr) => {};

  unshift = () => {};

  splice = (index: number, item: IArrEl, array: string[]) => {
    if (this.getSize() < this.maxSize) {
      array.splice(index, 1, item);
      if (this.head === -1) {
        this.head++;
      }
      this.tail++;
      this.currentIndex++;
      this.list = array;
    } else {
      throw new Error("Слишком много элементов");
    }
  };

  getSize = () => this.list.length;
}
export const list = new List();
